    .TxDataEsc_0          (TxDataEsc_0),
    .TxDataEsc_1          (8'h0),
    .TxDataEsc_2          (8'h0),
    .TxDataEsc_3          (8'h0),
    .TxDataEsc_4          (8'h0),
    .TxDataEsc_5          (8'h0),
